Please Read
Sorry for being a little MIA this past month. Been super busy with stupid stuff.

Had to re-edit 470 videos that are already on YouTube to prevent being deleted. That took about 2 solid weeks at 12-14 hours a day.

Then because YouTube is getting weird about links I had  change all the links that direct to the parts list for each video. Basically YouTube wants me to use a LinkTree type service.

But I found out that Link Tree and other similar companies don't allow weapon related content.

So then I had to create my own type of LinkTree that I can control.

After that my Computer took a crap, so I had to rebuild it. That took a few days of setting everything back up and waiting for a few parts to arrive.

Then a few days ago one of my biggest affiliates updated their website, which broke 1000's of affiliate links. So I had to fix all of those one by one. So that took a few days to fix. 

In case you're not aware, affiliate links are how I feed the family and keep the channel going.

Not complaining or anything just wanted to give you guys a heads up on why there haven't been many new videos. 

Nonetheless, I'm trying to get back in the groove of uploading videos this week. My apologies for all the delays. 

